import React from "react";
import { Routes, Route } from "react-router-dom";
import { publicRoutes } from "../../router";


const AppRouter = () => {
    return (
        <Routes>
            {publicRoutes.map(({ path, Component }) => 
                <Route key={ path } path={ path } element={ <Component /> } exact />
            )}
        </Routes>
    );
}

export default AppRouter;
